(66, 4, '2012-04-23 08:32:40', 'Magento Community Preview Version CE 1.7.0.0-RC1 has been released!', 'Learn more about the exciting new features and updates in this release and how you can take it for a test drive. As this is a preview version, we need to stress that it''s likely unstable and that we DON''T recommend that you use it in any production environment just yet.', 'http://www.magentocommerce.com/blog/comments/magento-preview-version-ce-1700-rc1-now-available/', 0, 0),
(67, 4, '2012-05-11 04:16:54', 'Magento Community 1.7 and Magento Enterprise 1.12 now available!', 'Learn more about the exciting new features and updates in these releases.', 'http://www.magentocommerce.com/blog/comments/magento-enterprise-112-and-community-17-now-available/', 0, 0),
(68, 4, '2012-06-20 13:24:07', 'Magento Community Edition 1.7.0.1 now available! ', 'We have just released an updated version of Magento Community Edition, version 1.7.0.1. This update delivers new, minor functionality and fixes for some potential security vulnerabilities.', 'http://www.magentocommerce.com/blog/comments/magento-community-edition-1701-released/', 0, 0),
(69, 4, '2012-07-05 13:51:43', 'Important Security Update - Zend Platform Vulnerability', 'We have recently learned of a serious vulnerability in the Zend platform on which Magento is built. Learn more and access a patch that addresses this issue. ', 'http://www.magentocommerce.com/blog/comments/important-security-update-zend-platform-vulnerability/', 0, 0),
(70, 4, '2012-11-19 14:57:42', 'Wrap up more holiday sales with financing', 'Give your customers up to 6 months financing. You get paid right away with Bill Me Later, a PayPal service. It’s a great way to extend financing in time for the holidays. Learn More.', 'http://www.magentocommerce.com/paypal/billmelater?utm_source=CEMessaging&utm_medium=copy&utm_content=sixmonths&utm_campaign=BML', 0, 0),
(71, 4, '2012-12-07 05:52:30', 'Increase Your Sales With PayPal', 'Magento merchants using PayPal Express Checkout can help increase their sales on average 18%. It is one simple thing you can do right now to help boost your sales. Learn more.', 'http://www.magentocommerce.com/add-paypal?utm_source=CEModule&utm_medium=copy&utm_content=18&utm_campaign=choosepaypal', 0, 0),
(72, 4, '2013-01-15 16:32:07', 'Imagine 2013 Registration is Now Open!', 'Join 1500 merchants, partners, developers and enthusiasts from 35+ countries around the world for Magento’s premier global conference! Collaborate, learn, network and get inspired by the future of eCommerce. Tickets will sell out fast! April 8th – 10th in Las Vegas.', 'https://registration.imagineecommerce.com/', 0, 0),
(73, 4, '2013-02-12 12:23:42', 'Get More eCommerce Power with Magento Enterprise', 'Limited time offer: Get a free, customized evaluation of your Community Edition site from a Magento Solution Partner. This evaluation gives you a clear look at the numerous benefits you can achieve by upgrading to Enterprise Edition. ', 'http://www.magentocommerce.com/community-to-enterprise?utm_source=CEMM&utm_medium=copy&utm_campaign=CE2EE', 0, 0),
(74, 2, '2013-09-27 11:58:13', 'Magento Community Edition 1.8.0.0 - now available for download!', 'Get tax, security, performance, and many other improvements. \n\nLearn more at http://www.magentocommerce.com/blog/comments/magento-community-edition-one-eight-now-available/ ', 'http://www.magentocommerce.com/blog/comments/magento-community-edition-one-eight-now-available/', 0, 0),
(75, 4, '2013-12-11 10:05:06', 'Magento Community Edition 1.8.1.0 is here!', 'This new version offers significant tax calculation, product quality, and security enhancements. Be sure to carefully review the upgrade instructions before starting. More information is available at http://www.magentocommerce.com/blog/comments/magento-community-edition-1810-is-here/', 'http://www.magentocommerce.com/blog/comments/magento-community-edition-1810-is-here/', 0, 0),
(76, 4, '2013-12-12 17:54:39', 'Important Magento Community Edition Patch', 'A security patch is available for Magento Community Edition 1.4.0.0 through 1.7.0.2; the issue has been fixed in Magento Community Edition 1.8.0.0 and later. It resolves a vulnerability discovered through our quarterly penetration testing process and has not been reported by merchants. We encourage all merchants to apply the patch in their next regularly scheduled maintenance cycle. The patch is available at http://www.magentocommerce.com/download in the Magento Community Edition Patches section.', 'http://www.magentocommerce.com/download', 0, 0),
(77, 4, '2014-01-21 13:04:48', 'PHP 5.4 Patch Now Available', 'Magento is advancing its platform and making development more efficient by adding support for PHP 5.4. Patches are available for download at www.magentocommerce.com/download and you can learn more about this update in our blog post at http://www.magentocommerce.com/blog/comments/magento-now-supports-php-54 .', 'http://www.magentocommerce.com/blog/comments/magento-now-supports-php-54', 0, 0),
(78, 4, '2014-02-20 12:21:46', 'Discover Card Validation Patch Available', 'A patch that resolves an issue with validating Discover credit cards is now available for download at http://www.magentocommerce.com/download. More information on the patch is available in the Magento Knowledge Base at http://www.magentocommerce.com/knowledge-base/entry/discover-card-validation', 'http://www.magentocommerce.com/knowledge-base/entry/discover-card-validation ', 0, 0),
(79, 4, '2014-03-04 09:42:26', 'Learn How to Quickly Increase Sales on Your Site', 'Adding the PayPal Express Checkout button to your checkout page can help increase sales 18% on average. It’s fast and easy and you can do it right now to boost sales. Express Checkout is already seamlessly integrated into Community Edition.', 'http://magento.com/paypal/CE_Express_Checkout_NA?utm_source=messagemodule&utm_medium=message&utm_campaign=Ceexpresscheckout', 0, 0),
(80, 4, '2014-05-13 11:16:11', 'Magento Community Edition 1.9 is now available!', 'It accelerates your entry into the mobile commerce space by slashing the time and cost of getting a mobile device-friendly responsive site.  And a new Bill Me Later payment option helps boost your sales. Visit http://magento.com/blog/magento-news/magento-enables-responsive-sites-half-time to learn more.', 'http://magento.com/blog/magento-news/magento-enables-responsive-sites-half-time', 0, 0),
(81, 4, '2014-10-07 23:25:06', 'It’s still not too late: Boost your 2014 Holiday sales today.', 'See results in as little as one week with eBay Enterprise Display and 2 business days with eBay Enterprise Affiliate. DID YOU KNOW: Get access to over 128 million highly qualified shoppers on eBay.com with eBay Enterprise Display. And the average retail client using product retargeting sees a $10 to $1 ROI on retargeting spend during Q4. With the eBay Enterprise Affiliate Network, get access to over 200,000 active network publishers across 30+ verticals, and only pay when a customer makes a purchase (Affiliate Network is only available in the U.S. & Canada).  GET STARTED TODAY by visiting www.ebayenterprise.com/turbochargesales', 'http://www.ebayenterprise.com/turbochargesales', 0, 0),
(82, 4, '2014-11-12 13:33:26', 'Important: PayPal Users Must Discontinue Using SSL 3.0 By December 3, 2014', 'To address a vulnerability with the SSL 3.0 security protocol, PayPal and other payment gateways will be disabling SSL 3.0 support. Merchants must upgrade to Transport Layer Service (TLS) by December 3, 2014 to avoid PayPal payment operation failures. Learn more about what you need to do at https://devblog.paypal.com/poodle-ssl-3-0-vulnerability/', 'https://devblog.paypal.com/poodle-ssl-3-0-vulnerability/', 0, 0),
(83, 4, '2014-11-24 17:55:21', 'Magento Community Edition 1.9.1 is available!', 'Magento Community Edition 1.9.1 empowers merchants to deliver compelling shopping experiences by offering enhanced responsive design capabilities, new swatches to display product variations, and improved performance through support for MySQL 5.6 and PHP 5.5. It also includes support for Google Universal Analytics and over 70 product improvements. Find out more at http://magento.com/blog/magento-news/magento-community-edition-191-now-available-download', 'http://magento.com/blog/magento-news/magento-community-edition-191-now-available-download', 0, 0),
(84, 4, '2015-01-22 12:17:08', 'Join Us at Imagine Commerce 2015 - April 20-22 at the Wynn Las Vegas', 'Join Magento, eBay Enterprise, and over 2,000 merchants, developers, and eCommerce experts at the premier Commerce event of the year. With three days of cutting-edge keynote presentations, special technical programs, dynamic breakout sessions, and incredible networking opportunities, Imagine Commerce 2015 will educate, enrich, and inspire you to take your business to new heights. Register now at http://imagine2015.magento.com/.', 'http://imagine2015.magento.com/', 0, 0),
(85, 4, '2008-11-08 11:46:42', 'Reminder: Change Magento`s default phone numbers and callouts before site launch', 'Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.', '', 0, 0),
(86, 1, '2015-04-16 23:17:07', 'Critical Reminder: Download and install Magento security patches.  Download now.', 'Download and implement 2 important security patches (SUPEE-5344 and SUPEE-1533) from the Magento Community Edition download page (https://www.magentocommerce.com/products/downloads/magento/).  If you have not done so already, download and install 2 previously-released patches that prevent an attacker from remotely executing code on Magento software.  These issues affect all versions of Magento Community Edition.  A press release from Check Point Software Technologies in the coming days will make one of these issues widely known, possibly alerting hackers who may try to exploit it.  Ensure the patches are in place as a preventative measure before the issue is publicized.', 'https://www.magentocommerce.com/products/downloads/magento/ ', 0, 0),
(87, 1, '2015-04-20 05:37:00', 'Second Reminder: Download and install Magento critical security patches now.', 'If you have not done so already, download and install 2 previously-released security patches (SUPEE-5344 and SUPEE-1533) from the Magento Community Edition download page (https://www.magentocommerce.com/products/downloads/magento/).  These security issues affect all versions of Magento Community Edition and enable an attacker to remotely execute code on Magento software. A press release from Check Point Software Technologies tomorrow  will make one of these issues widely known, possibly alerting hackers who may try to exploit it.  Ensure the patches are in place as a preventative measure before the issue is publicized.', 'https://www.magentocommerce.com/products/downloads/magento/', 0, 0),
(88, 1, '2015-04-24 02:43:31', 'Urgent: Immediately install Magento critical security patches', 'It is critical for you to download and install 2 previously-released security patches (SUPEE-5344 and SUPEE-1533) from the Magento Community Edition download page (https://www.magentocommerce.com/products/downloads/magento/).  Please do this immediately, as Check Point Software Technologies has published a technical description of how they discovered the issue, which we feel might serve as a tutorial for implementing an attack against your website. ', 'https://www.magentocommerce.com/products/downloads/magento/', 0, 0),
(89, 4, '2008-11-08 11:46:42', 'Reminder: Change Magento`s default phone numbers and callouts before site launch', 'Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.', '', 0, 0),
(90, 4, '2008-11-08 11:46:42', 'Reminder: Change Magento`s default phone numbers and callouts before site launch', 'Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.', '', 0, 0),
(91, 4, '2008-11-08 11:46:42', 'Reminder: Change Magento`s default phone numbers and callouts before site launch', 'Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.', '', 0, 0),
(92, 3, '2010-08-19 07:00:00', 'uDropship release 1.7.12', '===== 1.7.12 =====<br />\n  * Fixed preventing Magento from decreasing stock qty when Vendor Decision Method is local+vendor<br />\n<br />\n===== 1.7.11 =====<br />\n  * Fixed ignoring vendor specific handling fee when not set<br />\n<br />\n===== 1.7.10 =====<br />\n  * Added compatibility with CE 1.4.1.x for stock item override<br />\n  * Fixed generating statement PDF when logo image is invalid<br />\n<br />\n===== 1.7.9 =====<br />\n  * Fixed intermittent error when qty in cart is 0<br />\n  * Fixed statements compatibility with flat sales tables (CE 1.4.1.0)<br />\n<br />\n===== 1.7.8 =====<br />\n  * Fixed Reports > Dropship > General Details for non-flat sales tables (<1.4.1.0)<br />\n  * Added WYSIWYG control option in vendor preferences<br />\n<br />\n===== 1.7.7 =====<br />\n  * Theme updates for MultiVendor and Microsite add-ons<br />\n<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(93, 3, '2010-09-29 07:00:00', 'uDropship release 1.8.1.1', '===== 1.8.1.1 =====<br />\n  * Fixed vendor interface compatibility for IE7<br />\n<br />\n===== 1.8.1 =====<br />\n  * Fixed vendor interface order info in some installations<br />\n  * Fixed error on unknown shipping method in vendor interface<br />\n  * Added vendor notification flag fields to shipment entity tables<br />\n<br />\n===== 1.8.0 =====<br />\n  * Fixed mass vendor status update<br />\n  * Added support for custom estimate total price calculation method<br />\n  * Added support for AdvancedPO add-on', 'http://www.unirgy.com/products/udropship', 0, 0),
(94, 3, '2010-09-29 21:40:00', 'uDropship bug fix 1.8.1.2', 'Fixed intermittent issue in cart shipping estimates, introduced in the last version.<br />\nRecommended upgrade.', 'http://www.unirgy.com/products/udropship', 0, 0),
(95, 3, '2010-10-05 07:00:00', 'uDropship release 1.8.2', '===== 1.8.2 =====<br />\n  * Fixed statement adjustments when sales tables flat<br />\n  * Fixed calculation for totals saved in shipment records (for future use)<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(96, 3, '2010-10-19 07:00:00', 'uDropship release 1.8.2.2', '===== 1.8.2.2 =====<br />\n  * Fixed issue with statement totals when non-US currency format is used<br />\n  <br />\n===== 1.8.2.1 =====<br />\n  * Fixed decimal precision in flat shipment item table fields<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(97, 3, '2010-11-02 07:00:00', 'uDropship release 1.8.2.3', '===== 1.8.2.3 =====<br />\n  * Fixed vendor interface shipment comments for CE 1.3.x<br />\n  * Fixed estimate calculation logic when some of carrier requests fail<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(98, 3, '2010-11-18 07:00:00', 'uDropship release 1.9.0.0', '===== 1.9.0.0 =====<br />\n  * Additions and refactoring for AdvancedPO and Payout add-ons<br />\n  * Added user tracking for statement adjustments<br />\n  * Fixes in handling statements mass actions<br />\n  * Fixed handling multi-address checkout with Split add-on (PE 1.9.1.0 & CE 1.4.1.1)<br />\n  * Fixed changing vendor shipment status without comment<br />\n  <br />\n===== 1.8.2.7 =====<br />\n  * Fixed USPS long method names<br />\n  * Fixed printing Endicia international labels<br />\n<br />\n===== 1.8.2.6 =====<br />\n  * More major statements refactoring<br />\n  * Added statement details tab<br />\n<br />\n===== 1.8.2.5 =====<br />\n  * Refactored statement models<br />\n  * Added advanced adjustments management<br />\n  * Added refresh statements functionality as oppose to deleting to refresh<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(99, 3, '2010-11-22 07:00:00', 'uDropship release 1.9.1.0', 'IMPORTANT: Every uDropship release requires upgrade of all add-ons.<br />\n<br />\n===== 1.9.1.0 =====<br />\n  * Added configuration to use product cost instead of price for statements and payouts<br />\n  * Added configuration to replace Vendor dropdowns with auto-complete for large number of vendors<br />\n<br />\n===== 1.9.0.1 =====<br />\n  * Fixed using locale timezone in vendor''s shipment grid and filters<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(100, 3, '2010-11-29 07:00:00', 'uDropship release 1.9.2', '===== 1.9.2 =====<br />\n  * Added per-vendor configuration to hide shipping price in packing slip<br />\n  * Added global configuration to restrict PO statuses in vendor interface<br />\n  * Added support for FedEx MPS (Multi-Package Shipments)<br />\n  * Added low stock vendor email notifications<br />\n  * Fixed multiple product attributes edit mass action<br />\n  * Fixed editing vendor product stock qty in admin and vendor interface<br />\n<br />\n===== 1.9.1.1 =====<br />\n  * Fixed editing orders in admin with out of stock items when "Use local vendor if available" is enabled<br />\n  * Fixes for MultiVendor add-on<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(101, 3, '2010-12-28 07:00:00', 'uDropship release 1.9.3; Microsite 1.4.1; MultiVendor 1.4.2; AdvancedPO 1.1.0', 'uDropship<br />\n<br />\n===== 1.9.3 =====<br />\n  * Added separate handling of multiple PO action and status update in vendor interface<br />\n  * Added limiting vendor product availability by destination zipcode<br />\n  * Added new columns in general report<br />\n  * Added new item level report<br />\n<br />\nAdd-on: Microsite<br />\n<br />\n===== 1.4.1 =====<br />\n  * Added Vendor landing page custom title<br />\n  <br />\nAdd-on: MultiVendor <br />\n<br />\n===== 1.4.2 =====<br />\n  * Added limiting vendor product availability by destination zipcode<br />\n  <br />\n===== 1.4.1 =====<br />\n  * Fixed stock availability and item cost logic in order vendor reassign dropdowns<br />\n  * Fixed showing correct vendors in admin order item vendor reassign dropdowns<br />\n  * Fixed showing correct associated products in admin vendor edit and vendor interface stock page<br />\n<br />\nAdd-on: AdvancedPO<br />\n<br />\n===== 1.1.0 =====<br />\n  * Added separate handling of multiple PO action and status update in vendor interface<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(102, 3, '2011-01-11 07:00:00', 'uDropship release 1.9.3.4', '===== 1.9.3.4 =====<br />\n  * Fixed race condition error during installation on live sites<br />\n  * Fixed IE JS error in vendor interface when running action on multiple POs<br />\n<br />\n===== 1.9.3.3 =====<br />\n  * Fixed disabling uDropship per website/store<br />\n<br />\n===== 1.9.3.2 =====<br />\n  * Fixed filters in uDropship reports<br />\n<br />\n===== 1.9.3.1 =====<br />\n  * Added vendor configuration for Fedex ITN for EEI/SED shipments (from AES)<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(103, 3, '2011-02-11 07:00:00', 'uDropship 1.10.0.0; AdvancedPO 1.3.0; MultiVendor 1.4.5; SplitRate 1.4.1; Batch 1.4.2; Payout 1.0.1', 'uDropship:<br />\n<br />\n===== 1.10.0.0 =====<br />\n  * Tested for compatibility with CE 1.5.0.1<br />\n  * Fixed login to vendor interface when AdvancedPO is installed<br />\n  * Moved from "withhold" option to "in payout" options (reflected in PDF and statement/payout details page)<br />\n  * Fixed URL Key exists check for new vendor registrations (in admin, when Microsite is installed)<br />\n  * Fixed saving vendor data for new vendors after form submission error (in admin)<br />\n  * Removed handling from statement/payout (calculation and display)<br />\n  * Added note to handling fee field in vendor preferences, if default handling fee is desired<br />\n  * Worked around Magento bug with internal forwarding by frontName<br />\n  * Fixed potential issues with saving in order items vendor SKU, item price, shipping price<br />\n  <br />\nuDropship AdvancedPO:<br />\n<br />\n===== 1.3.0 =====<br />\n  * Fixed incorrect vendor assignment when creating PO shipment and order items have different vendors<br />\n  * Removed "Create PO" button from order page when order is not made using uDropship method<br />\n  * Added creating PO shipments from admin<br />\n  * Added reference to PO from admin shipment view page<br />\n  * Added separate "Add PO Comment" button in PO Info (vendor interface)<br />\n  * Fixed udpo::getShippingAmountLeft (didn''t skip canceled shipments)<br />\n  * Added event udropship_shipment_label_request_failed in Unirgy_Dropship_Model_Label_Batch::processShipments<br />\n  * Added when shipment create issued by create label request and it failed - unregister and delete shipment<br />\n  <br />\nuDropship MultiVendor:<br />\n<br />\n===== 1.4.5 =====<br />\n  * Fixed apply stock availability issues on order items<br />\n<br />\nuDropship SplitRate:<br />\n<br />\n===== 1.4.1 =====<br />\n  * Fixed free shipping by subtotal<br />\n  * Fixed calculating in time handling fee in cart and checkout<br />\n<br />\nuDropship Batch:<br />\n<br />\n===== 1.4.2 =====<br />\n  * Added stock inventory import for vendors<br />\n  * Added pages in vendor interface for importing inventory and tracking IDs<br />\n  * Replaced hidden "exported" status with explicit selection of statuses for orders to be exported<br />\n<br />\nuDropship Payout:<br />\n<br />\n===== 1.0.1 =====<br />\n  * Moving from "withhold" option to "in payout" options (reflected in payout details page)<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(104, 3, '2011-02-15 07:00:00', 'uDropship fixes for Magento DBs with table prefix', 'uDropship:<br />\n<br />\n===== 1.10.0.1 =====<br />\n  * Fixed foreign keys when Magento tables have local prefix<br />\n<br />\nuDropshipBatch:<br />\n<br />\n===== 1.4.3 =====<br />\n  * Fixed foreign keys when Magento tables have local prefix<br />\n<br />\nuDropshipPayout:<br />\n<br />\n===== 1.0.2 =====<br />\n  * Fixed foreign keys when Magento tables have local prefix<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(105, 3, '2011-02-17 07:00:00', 'uDropship 1.10.2.0; AdvancedPO 1.4.0', '===== 1.10.2.0 (PO: 1.4.0) =====<br />\n  * Added specifying shipping label options in vendor interface for UPS, USPS, FedEx<br />\n<br />\n===== 1.10.1.0 =====<br />\n  * Added Endicia configuration for automatic account funding<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(106, 3, '2011-03-02 07:00:00', 'uDropship 1.10.3.1; Batch 1.4.5; AdvancedPO 1.4.1; Payout 1.0.3', 'uDropship:<br />\n<br />\n===== 1.10.3.1 =====<br />\n  * Fixed handling 5+4 zip codes in USPS/Endicia labels<br />\n<br />\n===== 1.10.3.0 =====<br />\n  * Added UPS label API transaction void on label deletion<br />\n  * Added Endicia label API account recrediting on balance threshold<br />\n  * Fixed Endicia label API password change code<br />\n  * Fixed using simple subproduct''s cost for configurable products<br />\n  * Fixed issues with SQL reinstalls<br />\n  * Fixed compatibility with 1.3.2.4<br />\n  * Improved integration with 3rd party extensions (udropship_shipping_details)<br />\n<br />\nBatch:<br />\n<br />\n===== 1.4.5 =====<br />\n  * Fixed "Create Tracking Import Batch" button action<br />\n<br />\n===== 1.4.4 =====<br />\n  * Added events ''udbatch_prepare_po'', ''udbatch_prepare_po_item''<br />\n<br />\nAdvancedPO:<br />\n<br />\n===== 1.4.1 =====<br />\n  * Fixed issues with SQL reinstalls<br />\n<br />\nPayout:<br />\n<br />\n===== 1.0.3 =====<br />\n  * Fixed issues with SQL reinstalls<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(107, 3, '2011-03-25 07:00:00', 'uDropship 1.10.4.0; AdvancedPO 1.5.0; Batch 1.4.6; Microsite 1.4.2', 'uDropship:<br />\n<br />\n===== 1.10.4.0 =====<br />\n  * Fixed shipment comment with notify vendor by email<br />\n  * Fixed using frontend_input_renderer rather than frontend_input for vendor autocomplete<br />\n  * Fixed processPostMultiselects for vendor interface when no visible preferences are selected<br />\n  * Added initial new PO status per vendor<br />\n  * Added configuration per vendor for default PO sorting, PO status filter in vendor interface<br />\n<br />\n===== 1.10.3.2 =====<br />\n  * Fixed issues with SQL reinstalls<br />\n<br />\n<br />\nuDropship AdvancedPO:<br />\n<br />\n===== 1.5.0 =====<br />\n  * Fixed export CSV and Excel actions in grid<br />\n  * Fixed error when creating shipment with no checkboxes<br />\n  * Fixed handling not allowed status changes in vendor interface on "Create Shipment" action<br />\n  * Added initial new PO status per vendor<br />\n  * Added option to force PO status change when it''s not allowed<br />\n  * Added configuration per vendor for default PO sorting, PO status filter in vendor interface<br />\n  <br />\n<br />\nuDropship Batch:<br />\n<br />\n===== 1.4.6 =====<br />\n  * Added replacing new line char with custom string during fields export<br />\n<br />\n<br />\nuDropship Microsite:<br />\n<br />\n===== 1.4.2 =====<br />\n  * Fixed logging out to 404 Page not found on some installations<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0);
INSERT INTO `adminnotification_inbox` (`notification_id`, `severity`, `date_added`, `title`, `description`, `url`, `is_read`, `is_remove`) VALUES
(108, 3, '2011-04-05 07:00:00', 'uDropship 1.10.5.0; AdvancedPO 1.5.1; Batch 1.4.7; Microsite 1.4.3; Payout 1.1.0; SplitRate 1.4.2', 'uDropship:<br />\n<br />\n===== 1.10.5.0 =====<br />\n  * Fixed htmlEscape() in templates for 1.3.x<br />\n  * Fixed default filter status can''t be cleared in vendor interface<br />\n  * Fixed free_shipping by free_method_weight when carrier,method maps to multiple udropship shipping methods<br />\n  * Fixed adminhtml create po page for udsplit orders and other cases when can''t determine selected shipping metho<br />\n  * Fixed negative signs in statement PDF for transaction fee and commission<br />\n  * Fixed printing UPS labels when Pickup/Container/Destination types are not default<br />\n  * Added statement date (PO ready) field to POs, improved statements and payouts logic<br />\n  * Added support to use multiple shipping mapping for more flexible estimate override<br />\n  * Added commission amount field in statements rows<br />\n<br />\n<br />\nMicrosite:<br />\n<br />\n===== 1.4.3 =====<br />\n  * Fixed htmlEscape() in templates for 1.3.x<br />\n <br />\n<br />\nAdvancedPO:<br />\n<br />\n===== 1.5.1 =====<br />\n  * Fixed htmlEscape() in templates for 1.3.x<br />\n  * Fixed default values for PO status on Batch import/export<br />\n  * Fixed default filter status can''t be cleared in vendor interface<br />\n  * Fixed adminhtml create po page for udsplit orders and other cases when can''t determine selected shipping method <br />\n  * Added statement date (PO ready) field to POs, improved statements and payouts logic<br />\n <br />\n <br />\nPayout:<br />\n<br />\n===== 1.1.0 =====<br />\n  * Added statement (PO ready) date field to POs, improved statements and payouts logic<br />\n<br />\n<br />\nBatch: <br />\n<br />\n===== 1.4.7 =====<br />\n  * Fixed default values for PO status on Batch import/export<br />\n  * Fixed stock qty is not required field any more during import validation in vendor interface <br />\n <br />\n<br />\nSplitRate:<br />\n<br />\n===== 1.4.2 =====<br />\n  * Fixed free_shipping by free_method_weight when carrier,method maps to multiple udropship shipping methods<br />\n  * Added support to use multiple shipping mapping for more flexible estimate override<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(109, 3, '2011-04-26 07:00:00', 'uDropship 1.10.6.0; AdvancedPO 1.5.3; Batch 1.4.8; MultiVendor 1.4.7; Payout 1.1.1', 'uDropship:<br />\n<br />\n===== 1.10.6.0 =====<br />\n  * Added runtime update of statement date for legacy shipment/PO records<br />\n  * Added global configuration to disable/delete products for inactive/deleted vendors<br />\n  * Fixed reports compatibility with 1.4.0.1 (related to Magento core bug)<br />\n  * Fixed cost column in reports<br />\n<br />\nAdvancedPO:<br />\n<br />\n===== 1.5.3 =====<br />\n  * Fixed getVendorShipmentCollection in vendor interface<br />\n  * Fixed mass action submit to use the default filter<br />\n  * Fixed attaching PO PDF to vendor notification email<br />\n<br />\nMultiVendor:<br />\n<br />\n===== 1.4.7 =====<br />\n  * Added assigning vendor SKU to PO items when AdvancedPO is installed<br />\n<br />\nBatch:<br />\n<br />\n===== 1.4.8 =====<br />\n  * Added vendor SKU field for PO items (with or without AdvancedPO) [item.vendor_sku]<br />\n<br />\nPayout:<br />\n<br />\n===== 1.1.1 =====<br />\n  * Added runtime fixing statement date for legacy records<br />\n<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(110, 3, '2012-03-19 07:00:00', 'Batch 1.5.0; Microsite 1.4.4; MultiVendor 1.4.8; Payout 1.1.3; AdvancedPO 1.6.4; SplitRate 1.4.3', 'uDropship Batch:<br />\n===== 1.5.0 =====<br />\n  * Added log po status change in batch exportUpdatePOsStatus/importUpdatePOsStatus<br />\n  * Added filter when exportUpdatePOsStatus to eliminate duplicate status update on export when doing retry dists<br />\n  * Added ability to import stock by vendor sku<br />\n  * Added remove redundant 4 digits precision with value*1 (only for [var.subvar] syntax)<br />\n  * Fixed grid rows update after import<br />\n<br />\nuDropship Microsite:<br />\n===== 1.4.4 =====<br />\n  * Added layered navigation on microsite home page (root category must be anchor!)<br />\n  * Fixed product list sorting and paging on microsite home page<br />\n<br />\nuDropship MultiVendor:<br />\n===== 1.4.8 =====<br />\n  * Added addVendorSku functionality and revamp assignVendorSku<br />\n    from now vendor_sku stored in po items rather then constantly fetched from products<br />\n  * Added sync multivendor stock with magento stock when save products from vendor interface and admin vendor edit page<br />\n  * Fixed is_scalar(null) issue on some invocations of helper::getMultiVendorData<br />\n  <br />\nuDropship Payout:<br />\n===== 1.1.3 =====<br />\n  * Fixed move udpo related install code into udpo<br />\n  * Fixed paypal method in live mode (https://www.paypal.com/wsdl/PayPalSvc.wsdl intended for live environment refer sandbox urls)<br />\n  <br />\nuDropship Advanced PO:<br />\n===== 1.6.4 =====<br />\n  * Moved everything from Unirgy_DropshipPo_Model_Batch to Unirgy_DropshipBatch_Model_Batch with conditions check<br />\n  * Extended udropship/purchase_order/autoinvoice_shipment option<br />\n    this allows invoice whole order on first shipment as a workaround<br />\n    to support payment methods that does not have partial capture<br />\n  * Added checks and special treatment of virtual items<br />\n  * Added option udropship/purchase_order/create_po_allow_change_costs<br />\n    Allow change costs when manualy create po<br />\n  * Added format costs as prices on po view, add row cost column on po view page<br />\n  * Added ability to resend vendor po notifications<br />\n  * Added separate hide_udpo_pdf_shipping_amount option to hide amounts in po pdf<br />\n  * Fixed Transactional Emails not showing up in System > Transactional Emails > Add New Template<br />\n  * Fixed grid rows update after import with DropshipBatch<br />\n  * Fixed udpos grid tab on order page<br />\n  <br />\n===== 1.6.0 =====<br />\n  * Added configuration to not allow vendors to change PO status (from/to)<br />\n  * Added integration with new module uDropship PO MPS<br />\n  * Added error notifications by email (label_request_failed,poll_tracking_failed,poll_tracking_limit_exceeded)<br />\n  * Fixed Mage_Sales_Model_Order_Invoice::isLast() magento core bug for partial invoicing<br />\n  * Fixed auto-invoicing in some cases<br />\n  * Fixed compatibility with 1.3.2.4<br />\n  * Fixed showing transactional emails in System > Transactional Emails > Add New Template<br />\n  <br />\nuDropship SplitRate:<br />\n===== 1.4.3 =====<br />\n  * Added option to hide items amounts and subtotal on shipping method page<br />\n  * Added option to hide vendor names on checkout<br />\n  * Added compatibility with magento >1.5.0.1 changes in checkout review template<br />\n    caused problems with authorize.net direct post<br />\n  * Fixed problem on checkout when all vendor items virtual<br />\n  * Fixed potential problem when custom code tries to do something with product type model<br />\n  <br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(111, 3, '2012-03-20 07:00:00', 'uDropship 2.0.0; Batch 2.0.6; Microsite 2.0.0; MultiVendor 2.0.0; AdvancedPO 2.0.0; SpliRate 2.0.0', 'uDropship:<br />\n===== 2.0.0 =====<br />\n  * Fixed "Delivery Method" filter in vendor interface<br />\n  * Fixed vendor::getShippingMethods now shows only methods that could be used by vendor<br />\n    based on preferred carrier and overrides, otherwise filter them out<br />\n  * Added shipping methods validation on vendor save - notify of methods that can''t be saved<br />\n  * Added carriers/udropship/free_shipping_allowed wrapper to enable/disable both free shipping at once<br />\n  * Added carriers/udropship/freeweight_allowed to control usage of free weight during free shipping<br />\n  * Added extended dependSelect in config to support chain of depends<br />\n  * Added Unirgy_Dropship_Model_Mysql4_Setup::createDependConfigPath<br />\n    to add new config depend fields that have existing dependent fields<br />\n  * Fixed vendor area "inform retailer" $partialQty = 0 not included in notification email<br />\n  * Fixed Fedex label printing after magento moved to webservice rates (ce 1.6.0)<br />\n  * Fixed workaround for duplicate PO problem<br />\n  * Added ability to modify shipping origin from vendor  interface<br />\n  * Fixed compatibility with 1401 when payment method action is sale (order not split to POs during place)<br />\n  * Fixed handling calculation for Item Separate Rate with Fixed handling fee per package<br />\n  * Changed "Limit to zipcodes" vendor preference.<br />\n    Now expect rules to be separated by new line, comma or semicolon.<br />\n    And does not clear whitespace inside rules to be compatible with UK zipcodes that contain spaces.<br />\n  * Added array_merge_n helper function to recursive merge with numeric keys preserve carrier methods on<br />\n    Sales > Dropship > Shipping Methods > Shipping Edit > "Associated System Methods" tab<br />\n    to support carriers that have numeric method codes like Webshopapps_Wsaupsfreight module<br />\n  * Fixed compatibility with ce1.6/ee1.11<br />\n    related to db field change from sales_flat_shipment_track.number to sales_flat_shipment_track.track_number<br />\n  * Added show gift messages in vendor notification emails<br />\n  * Fixed addVendorSku caused by inconsistency between Varien_Object::__call and Varien_Object::hasData methods<br />\n    (first use isset, second array_key_exists - not compatible for NULL values)<br />\n  * Added ''* Use Estimate'' carrier override option to stick with ''Use Rates Fallback Chain'' functionality<br />\n  * Added vendor option ''Use Rates Fallback Chain''<br />\n  * Fixed statement pdf adjustment in po rows price formatted<br />\n  * Added product attribute ''Dropship Rates Calculation Type'' (calculate rate separately per row/item in cart)<br />\n  <br />\n  <br />\nuDropship Batch:<br />\n===== 2.0.6 =====<br />\n  * Added inventory import optimizations and related "Reindex Type" vendor field<br />\n  * Added giftmessages export via<br />\n    [order.gift_message_from]<br />\n    [order.gift_message_from_with_label]<br />\n    [order.gift_message_to]<br />\n    [order.gift_message_to_with_label]<br />\n    [order.gift_message_text]<br />\n    [order.gift_message_text_with_label]<br />\n    [order.gift_message_combined]<br />\n    and related [order_item.*]<br />\n  * Added [vendor] to export vars<br />\n  * Added export of [system_carrier_title], [system_carrier_code], [system_method_title], [system_method_code]<br />\n  * Added support to export [udropship_method_code], [udropship_method_title]<br />\n    regardless if it''s splitrate or bare udropship (using helper(''udropship'')::mapSystemToUdropshipMethod($code, $vendor))<br />\n  * Fixed skip directories in wildcard locations<br />\n  <br />\n===== 2.0.3 =====<br />\n  * Added ability to import stock by vendor_sku<br />\n  * Added import adapters<br />\n  * Added ability to export multiple files per location (file per PO or other type of grouping defined in custom adapter)<br />\n  * Added ability to use wildcard in locations to import multiple files per location<br />\n  * Added tracking of last import timestamp (with a timezone configuration of location) to further import only new files<br />\n  * Added actions on imported files (delete, rename, move, rename+move)<br />\n  * Added usage of IO models with common interface to process locations<br />\n<br />\n  * Added support for priority field import<br />\n  * Added ability to import new vendor/product associations via inventory import<br />\n  * Added support for new inventory import column stock_qty_add for stock increment/decrement<br />\n  * Added instant batch orders export method<br />\n<br />\n  * Added extended template filter to support constructs like<br />\n    {{depend order.getInvoiceCollection().count()}}{{var order.getInvoiceCollection().getFirstItem().getCreatedAt()}}{{/depend}<br />\n  * Fixed usage of bcc<br />\n  <br />\n<br />\nuDropship Microsite:<br />\n===== 2.0.0 =====<br />\n  * Fixed vendor custom theme for admin area (Manage Products setting)<br />\n  * Fixed "Product attributes to HIDE from vendors" compatibility with 1.6.x<br />\n  * Added "From URL Path (domain.com/vendor)" option to udropship/microsite/subdomain_level<br />\n  * Added option ''udropship/microsite/front_show_all_products'' to show all associated products<br />\n    vendor defined both in udropship_vendor attribute and in multivendor assignment<br />\n  * Added option "Stick microsite products in cart"<br />\n    Products that added to cart from vendor microsite will be stuck to that vendor regardless of decision method.<br />\n    "Yes and display vendor" - will display vendor name as item custom option.<br />\n  * Added "Limit Categories" vendor preference<br />\n  * Added "Limit Websites" vendor preference and filter store switcher<br />\n  <br />\n<br />\nuDropship MultiVendor:<br />\n===== 2.0.0 =====<br />\n  * Added optimization for huge inventory update<br />\n  * Added support for stock_qty_add field during stock update (for increment/decrement)<br />\n  * Added extra priority condition<br />\n  * Fixed authenticate problem when using non-unique emails<br />\n  * Added consider of ''skip_udmulti_load'' product collection flag<br />\n  * Fixed stock check problem due to stock item assigned to cart product multiple times<br />\n  * Added options to ''Configuration > Drop Shipping > Product Stock Options''<br />\n    - ''Vendor Decision Method For Reassign'' separate decision method used to check vendors stock when doing reassign<br />\n    - ''Skip Stock Check For Reassign''<br />\n  * Fixed addVendorSku caused by inconsistency between Varien_Object::__call and Varien_Object::hasData methods<br />\n    (first use isset, second array_key_exists - not compatible for NULL values)<br />\n    <br />\n    <br />\nuDropship Advanced PO:<br />\n===== 2.0.0 =====<br />\n  * Added option "Hide vendors that failed stock check on admin area Create PO page"<br />\n  * Added show gift messages in vendor notification emails<br />\n  * Added options to ''Configuration > Drop Shipping > Product Stock Options''<br />\n    - ''Vendor Decision Method For Reassign'' separate decision method used to check vendors stock when doing reassign<br />\n    - ''Skip Stock Check For Reassign''<br />\n  * Fixed invoiceShipment<br />\n    - capture offline when garnd_total=0<br />\n    - wrap in transaction in case it''s executed not from transaction context<br />\n  * Added "Do Not Automatically Generate PO" flag in admin order create page<br />\n  * Added ability to modify costs of existing POs<br />\n  * Fixed udpos tab grid action on order page<br />\n  <br />\n  <br />\nuDropship SplitRate:<br />\n===== 2.0.0 =====<br />\n  * Fixed check for virtual products<br />\n  * Added support for extra charge cloned shipping options<br />\n  * Added compatibility with wildcard "* Any available" udropship shipping method definition<br />\n  * Added ability to setup default shipping method per vendor<br />\n  * Added compatibility with some external checkouts (as if defaults selected)', 'http://www.unirgy.com/products/udropship', 0, 0),
(112, 3, '2012-04-20 07:00:00', 'uDropship 2.0.0.5; Batch 2.0.8; Microsite 2.0.4', 'uDropship:<br />\n===== 2.0.0.5 =====<br />\n  * Fixed empty batches on CE1.6<br />\n  * Added show original order item vendor on order view page<br />\n  * Fixed possible "PHP Fatal error: Nesting level too deep - recursive dependency? in Protected.php"<br />\n<br />\nuDropship Batch:<br />\n===== 2.0.8 =====<br />\n  * Fixed wildcard problem for cron run<br />\n===== 2.0.7 =====<br />\n  * Fixed import orders on CE 1.6 due to track_number field change<br />\n<br />\nuDropship Microsite:<br />\n===== 2.0.4 =====<br />\n  * Fixed pagination on microsite when update store base url = No<br />\n  * Fixed product view page Not Found related to udropship/microsite/front_show_all_products option<br />\n  * Added redirect to vendor login instead of admin login when session expire due to inactivity', 'http://www.unirgy.com/products/udropship', 0, 0),
(113, 3, '2012-05-18 07:00:00', 'uDropship 2.0.0.8; AdvancedPO 2.0.3; Batch 2.0.9', 'uDropship:<br />\n===== 2.0.0.8 =====<br />\n  * Added separate customer address templates for vendor pdf/html<br />\n  * Show order items PO Info on order view page<br />\n<br />\nAdvancedPO:<br />\n===== 2.0.3 =====<br />\n  * Added separate customer address templates for vendor pdf/html<br />\n  * Show order items PO Info on order view page<br />\n<br />\nBatch:<br />\n===== 2.0.9 =====<br />\n  * Added skip fileactions/timestamp update on paste content/upload location during manual import<br />\n<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(114, 3, '2012-05-31 07:00:00', 'uDropship 2.0.0.10; Batch 2.0.10; AdvancedPO 2.0.6; Microsite 2.0.6; StockPO 1.0.0', 'uDropship:<br />\n===== 2.0.0.10 =====<br />\n  * Fixed endicia issue with mailclass<br />\n  * Fixed consider Mage_Advancedsmtp enabled flag<br />\n<br />\n===== 2.0.0.9 =====<br />\n  * Fixed use fallback rates problem when order of carrier in request chain different then estimate/override/default<br />\n<br />\nBatch:<br />\n===== 2.0.10 =====<br />\n  * Added logic to support new Unirgy_DropshipStockPo add-ons<br />\n  * Added batch export type "instant by status", "instant"<br />\n  * Fixed references to udmulti when using bare udropship<br />\n<br />\nAdvancedPO:<br />\n===== 2.0.6 =====<br />\n  * Added vendor email notification by PO status<br />\n  * Added logic to support new Unirgy_DropshipStockPo add-ons<br />\n<br />\nMicrosite:<br />\n===== 2.0.6 =====<br />\n  * Fixed pages return 404 when update store base URL = No and using subdomains<br />\n===== 2.0.5 =====<br />\n  * Fixed infinite loop in store->getBaseUrl<br />\n<br />\nStockPO:<br />\n===== 1.0.0 =====<br />\n  * Initial release', 'http://www.unirgy.com/products/udropship', 0, 0),
(115, 3, '2012-06-06 07:00:00', 'uDropship 2.0.0.11; Microsite 2.0.8; Batch 2.0.11; AdvancedPO 2.0.6; StockPO 1.0.1; SplitRate 2.0.2; MultiVendor 2.0.4', 'uDropship:<br />\n===== 2.0.0.11 =====<br />\n  * Added interface to call endicia ChangePassPhraseRequest request. Need to specify in<br />\n    vendor edit > preferences > "Endicia (USPS) Specific"  > "New Pass Phrase" / "Confirm New Pass Phrase"<br />\n    <br />\nMicrosite:<br />\n===== 2.0.8 =====<br />\n  * Fixed 404 product page in vendor microsite<br />\n 	  when using bare udropship or multivendor decision method turned off<br />\n 	  and udropship/microsite/front_show_all_products=yes<br />\n 	  <br />\nBatch:<br />\n===== 2.0.11 =====<br />\n  * Fixed setSkipFileactionsFlag function on non-object error<br />\n<br />\nAdvancedPO:<br />\n===== 2.0.6 =====<br />\n  * Added vendor email notification by PO status<br />\n  * Added logic to support new Unirgy_DropshipStockPo add-ons  <br />\n<br />\nStockPO:<br />\n===== 1.0.1 =====<br />\n  * Remove debug log<br />\n  <br />\nSplitRate:<br />\n===== 2.0.2 =====<br />\n  * Fixed default shipping<br />\n  <br />\nMultiVendor:<br />\n===== 2.0.4 =====<br />\n  * Fixed shipments total_cost update during reassign', 'http://www.unirgy.com/products/udropship', 0, 0),
(116, 3, '2012-06-19 07:00:00', 'uDropship 2.0.0.13; Batch 2.0.12; AdvancedPO 2.0.7; MultiVendor 2.0.5', 'uDropship:<br />\n===== 2.0.0.13 =====<br />\n  * Added generate label support for Fedex SOAP module from webshopapps<br />\n  * Fixed customer shipment notification configuration does not turns off<br />\n  * Fixed vendor_simple_sku<br />\n  * Fidex endicia service do not apply for international<br />\n    turned off delivery confirmation for international regardless of configuration<br />\n  * Fixed endicia labels for international "First-Class Mail International ..."<br />\n  <br />\nBatch:<br />\n===== 2.0.12 =====<br />\n  * Fixed reference to stockpo in export_orders batch type<br />\n  <br />\nAdvancedPO:<br />\n===== 2.0.7 =====<br />\n  * Fixed vendor_simple_sku<br />\n  <br />\nMultiVendor:<br />\n===== 2.0.5 =====<br />\n  * Fixed vendor_simple_sku', 'http://www.unirgy.com/products/udropship', 0, 0),
(117, 3, '2012-06-26 07:00:00', 'uDropship 2.0.0.14; AdvancedPO 2.0.8', 'uDropship:<br />\n===== 2.0.0.14 =====<br />\n  * Added configuration for each package in FedEx MPS<br />\n<br />\nAdvancedPO:<br />\n===== 2.0.8 =====<br />\n  * Added configuration for each package in FedEx MPS<br />\n  * Fixed vendor_simple_sku<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
(118, 3, '2012-07-05 07:00:00', 'uDropship 2.0.0.5, MultiVendor 2.0.6, AdvancedPO 2.0.9, SplitRate 2.0.3', 'uDropship:<br />\n===== 2.0.0.15 =====<br />\n  * Added ability to apply commission on tax<br />\n  * Fixed USPS international labels with non-default label width/height settings<br />\n  * Fixed "Wrong Content Type." when add udropship shipping method in ce1.7.0<br />\n  <br />\nMultiVendor:<br />\n===== 2.0.6 =====<br />\n  * Fixed set shipping method during reassign for non-shipped items<br />\n  <br />\nAdvancedPO:<br />\n===== 2.0.9 =====<br />\n  * Fixed create shipment does not create shipment in vendor interface when "partial qty" not set<br />\n  * Fixed recently broken udpos grid tab in order view<br />\n  <br />\nSplitRate:<br />\n===== 2.0.3 =====<br />\n  * Fixed Fatal error: Call to a member function getStoreId() on a non-object<br />\n    in app/code/community/Unirgy/Dropship/Model/Observer.php on line 189', 'http://www.unirgy.com/products/udropship', 0, 0),
(119, 3, '2012-09-19 07:00:00', 'uDropship 2.1.1; Batch 2.1.1; Microsite 2.1.0; MultiVendor 2.1.0; Payout 2.1.0; AdvancedPO 2.1.0; SplitRate 2.1.1', 'uDropship:<br />\n===== 2.1.1 =====<br />\n  * Fixed recognize freeshipping rules<br />\n  * Fixed freeweight freeshipping not fully applied (handling applied but should not)<br />\n===== 2.1.0 =====<br />\n  * Added support for marketplace suit of add-ons<br />\n  * Added extra hook event to process each system rate result<br />\n===== 2.0.0.17 =====<br />\n  * Added default global setting for "Statement calculation based on" and "Statement on following po/shipment statuses"<br />\n  * Added stock check after quote load except cart add/update or if quote->getUdSkipQuoteLoadAfterEvent()=true<br />\n  * Fixed system shipping method not shows in vendor packingslip<br />\n  * Added better stock check, messages, reindex (for multivendor add-on)<br />\n  * Added ability to select vendor in admin create order (for multivendor add-on)<br />\n===== 2.0.0.16 =====<br />\n  * Added backorders support for multivendor add-on<br />\n  <br />\n  <br />\nBatch:<br />\n===== 2.1.1 =====<br />\n  * Fixed wrongreference field<br />\n===== 2.1.0 =====<br />\n  * Added support for marketplace suit of add-ons<br />\n  * Fixed base dir protection check<br />\n  <br />\n  <br />\nMicrosite:<br />\n===== 2.1.0 =====<br />\n  * Added support for marketplace suit of add-ons<br />\n  * Added breadcrumbs in microsite landing page<br />\n  <br />\n  <br />\nMultiVendor:<br />\n===== 2.1.0 =====<br />\n  * Added support for marketplace suit of add-ons<br />\n===== 2.0.8 =====<br />\n  * Added stock check after quote load except cart add/update or if quote->getUdSkipQuoteLoadAfterEvent()=true<br />\n  * Fixed empty costs set in decision methods (should be fallback to product cost)<br />\n  * Added better stock check, messages, reindex<br />\n  * Added ability to select vendor in admin create order<br />\n===== 2.0.7 =====<br />\n  * Added backorders support<br />\n  <br />\nPayout:<br />\n===== 2.1.0 =====<br />\n  * Added support for marketplace suit of add-ons<br />\n  <br />\nAdvancedPO:<br />\n===== 2.1.0 =====<br />\n  * Added support for marketplace suit of add-ons<br />\n  * Fixed Advanced PO report vendor filter<br />\n===== 2.0.10 =====<br />\n  * Added default global setting for "Statement calculation based on" and "Statement on following po/shipment statuses"<br />\n  * Fixed system shipping method not shows in PO PDF<br />\n  <br />\nSplitRate:<br />\n===== 2.1.1 =====<br />\n  * Fixed recognize freeshipping rules<br />\n===== 2.1.0 =====<br />\n  * Added support for marketplace suit of add-ons<br />\n  * Added extra hook event to process each sytem rate result<br />\n  * Fixed shipping extra charge not reflected on checkout<br />\n  * Fixed problem on checkout when shipping method could not be selected (on some php installations)<br />\n', 'http://www.unirgy.com/products/udropship', 0, 0),
