(1, 'Footer Links', 'footer_links', '\n<ul>\n    <li><a href="{{store direct_url="about-magento-demo-store"}}">About Us</a></li>\n    <li><a href="{{store direct_url="customer-service"}}">Customer Service</a></li>\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy</a></li>\r\n</ul>', '2015-04-07 04:53:21', '2015-04-07 04:53:24', 1),
(2, 'Footer Links Company', 'footer_links_company', '\n<div class="links">\n    <div class="block-title">\n        <strong><span>Company</span></strong>\n    </div>\n    <ul>\n        <li><a href="{{store url=""}}about-magento-demo-store/">About Us</a></li>\n        <li><a href="{{store url=""}}contacts/">Contact Us</a></li>\n        <li><a href="{{store url=""}}customer-service/">Customer Service</a></li>\n        <li><a href="{{store url=""}}privacy-policy-cookie-restriction-mode/">Privacy Policy</a></li>\n    </ul>\n</div>', '2015-04-07 04:53:23', '2015-04-07 04:53:23', 1),
(3, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2015-04-07 04:53:24', '2015-04-07 04:53:24', 1),
(4, 'Sub Category Listing', 'subcategory_listing', '<p>{{block type="catalog/navigation" template="catalog/navigation/subcategory_listing.phtml"}}</p>', '2015-09-16 19:20:44', '2015-09-16 19:20:44', 1),
(5, 'Market V3 Block Policy', 'block-policy-v3', '<div class="banner-policy">\r\n<div class="inner">\r\n<div class="policy policy1"><a href="javascript:void(0)"><span class="ico-policy">RFQ received</span>RFQ received</a></div>\r\n<div class="policy policy2"><a href="javascript:void(0)"><span class="ico-policy">req sent</span>req sent</a></div>\r\n<div class="policy policy3"><a href="javascript:void(0)"><span class="ico-policy">orders received</span>orders received</a></div>\r\n<div class="policy policy4"><a href="javascript:void(0)"><span class="ico-policy">orders placed</span>orders placed</a></div>\r\n</div>\r\n</div>', '2015-09-16 19:21:19', '2015-09-29 12:51:48', 1),
(6, 'Ad Banner Home', 'ad-banner-home', '<div class="banner-home">\r\n<div class="banner2 banner2-1 col-lg-4 col-md-4 col-sm-6 col-xs-12"><a href="#"><img alt="" src="{{media url="wysiwyg/6.png"}}" /></a></div>\r\n<div class="banner2 banner2-2 col-lg-4 col-md-4 col-sm-6 col-xs-12"><a class="row1" href="#"><img alt="" src="{{media url="wysiwyg/8.png"}}" /></a> <a href="#"><img alt="" src="{{media url="wysiwyg/ad-small.jpg"}}" /></a></div>\r\n<div class="banner2 banner2-3 col-lg-4 col-md-4 col-sm-6 col-xs-12"><a href="#"><img alt="" src="{{media url="wysiwyg/7.png"}}" /></a></div>\r\n</div>', '2015-09-16 19:21:42', '2015-09-16 19:21:42', 1);
