(5, 'Enable Cookies', 'one_column', NULL, NULL, 'enable-cookies', NULL, '<div class="std">\n    <ul class="messages">\n        <li class="notice-msg">\n            <ul>\n                <li>Please enable cookies in your web browser to continue.</li>\n            </ul>\n        </li>\n    </ul>\n    <div class="page-title">\n        <h1><a name="top"></a>What are Cookies?</h1>\n    </div>\n    <p>Cookies are short pieces of data that are sent to your computer when you visit a website.\n    On later visits, this data is then returned to that website. Cookies allow us to recognize you automatically\n    whenever you visit our site so that we can personalize your experience and provide you with better service.\n    We also use cookies (and similar browser data, such as Flash cookies) for fraud prevention and other purposes.\n     If your web browser is set to refuse cookies from our website, you will not be able to complete a purchase\n     or take advantage of certain features of our website, such as storing items in your Shopping Cart or\n     receiving personalized recommendations. As a result, we strongly encourage you to configure your web\n     browser to accept cookies from our website.</p>\n    <h2 class="subtitle">Enabling Cookies</h2>\n    <ul class="disc">\n        <li><a href="#ie7">Internet Explorer 7.x</a></li>\n        <li><a href="#ie6">Internet Explorer 6.x</a></li>\n        <li><a href="#firefox">Mozilla/Firefox</a></li>\n        <li><a href="#opera">Opera 7.x</a></li>\n    </ul>\n    <h3><a name="ie7"></a>Internet Explorer 7.x</h3>\n    <ol>\n        <li>\n            <p>Start Internet Explorer</p>\n        </li>\n        <li>\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\n            <p><img src="{{skin url="images/cookies/ie7-1.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Privacy</strong> tab</p>\n            <p><img src="{{skin url="images/cookies/ie7-2.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Advanced</strong> button</p>\n            <p><img src="{{skin url="images/cookies/ie7-3.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>,\n            put another check mark in the <strong>Always accept session cookies </strong>box</p>\n            <p><img src="{{skin url="images/cookies/ie7-4.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src="{{skin url="images/cookies/ie7-5.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src="{{skin url="images/cookies/ie7-6.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Restart Internet Explore</p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n    <h3><a name="ie6"></a>Internet Explorer 6.x</h3>\n    <ol>\n        <li>\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\n            <p><img src="{{skin url="images/cookies/ie6-1.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> tab</p>\n        </li>\n        <li>\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>)\n            under <strong>Settings</strong>. Click <strong>OK</strong></p>\n            <p><img src="{{skin url="images/cookies/ie6-2.gif"}}" alt="" /></p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n    <h3><a name="firefox"></a>Mozilla/Firefox</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\n            <p><img src="{{skin url="images/cookies/firefox.png"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Expand the <strong>Cookies</strong> section</p>\n        </li>\n        <li>\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n    <h3><a name="opera"></a>Opera 7.x</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\n            <p><img src="{{skin url="images/cookies/opera.png"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong>\n            should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong></p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n</div>\n', '2015-04-07 04:53:23', '2015-04-07 04:53:23', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 'Privacy Policy', 'one_column', NULL, NULL, 'privacy-policy-cookie-restriction-mode', 'Privacy Policy', '<p style="color: #ff0000; font-weight: bold; font-size: 13px">\n    Please replace this text with you Privacy Policy.\n    Please add any additional cookies your website uses below (e.g., Google Analytics)\n</p>\n<p>\n    This privacy policy sets out how {{config path="general/store_information/name"}} uses and protects any information\n    that you give {{config path="general/store_information/name"}} when you use this website.\n    {{config path="general/store_information/name"}} is committed to ensuring that your privacy is protected.\n    Should we ask you to provide certain information by which you can be identified when using this website,\n    then you can be assured that it will only be used in accordance with this privacy statement.\n    {{config path="general/store_information/name"}} may change this policy from time to time by updating this page.\n    You should check this page from time to time to ensure that you are happy with any changes.\n</p>\n<h2>What we collect</h2>\n<p>We may collect the following information:</p>\n<ul>\n    <li>name</li>\n    <li>contact information including email address</li>\n    <li>demographic information such as postcode, preferences and interests</li>\n    <li>other information relevant to customer surveys and/or offers</li>\n</ul>\n<p>\n    For the exhaustive list of cookies we collect see the <a href="#list">List of cookies we collect</a> section.\n</p>\n<h2>What we do with the information we gather</h2>\n<p>\n    We require this information to understand your needs and provide you with a better service,\n    and in particular for the following reasons:\n</p>\n<ul>\n    <li>Internal record keeping.</li>\n    <li>We may use the information to improve our products and services.</li>\n    <li>\n        We may periodically send promotional emails about new products, special offers or other information which we\n        think you may find interesting using the email address which you have provided.\n    </li>\n    <li>\n        From time to time, we may also use your information to contact you for market research purposes.\n        We may contact you by email, phone, fax or mail. We may use the information to customise the website\n        according to your interests.\n    </li>\n</ul>\n<h2>Security</h2>\n<p>\n    We are committed to ensuring that your information is secure. In order to prevent unauthorised access or disclosure,\n    we have put in place suitable physical, electronic and managerial procedures to safeguard and secure\n    the information we collect online.\n</p>\n<h2>How we use cookies</h2>\n<p>\n    A cookie is a small file which asks permission to be placed on your computer''s hard drive.\n    Once you agree, the file is added and the cookie helps analyse web traffic or lets you know when you visit\n    a particular site. Cookies allow web applications to respond to you as an individual. The web application\n    can tailor its operations to your needs, likes and dislikes by gathering and remembering information about\n    your preferences.\n</p>\n<p>\n    We use traffic log cookies to identify which pages are being used. This helps us analyse data about web page traffic\n    and improve our website in order to tailor it to customer needs. We only use this information for statistical\n    analysis purposes and then the data is removed from the system.\n</p>\n<p>\n    Overall, cookies help us provide you with a better website, by enabling us to monitor which pages you find useful\n    and which you do not. A cookie in no way gives us access to your computer or any information about you,\n    other than the data you choose to share with us. You can choose to accept or decline cookies.\n    Most web browsers automatically accept cookies, but you can usually modify your browser setting\n    to decline cookies if you prefer. This may prevent you from taking full advantage of the website.\n</p>\n<h2>Links to other websites</h2>\n<p>\n    Our website may contain links to other websites of interest. However, once you have used these links\n    to leave our site, you should note that we do not have any control over that other website.\n    Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst\n    visiting such sites and such sites are not governed by this privacy statement.\n    You should exercise caution and look at the privacy statement applicable to the website in question.\n</p>\n<h2>Controlling your personal information</h2>\n<p>You may choose to restrict the collection or use of your personal information in the following ways:</p>\n<ul>\n    <li>\n        whenever you are asked to fill in a form on the website, look for the box that you can click to indicate\n        that you do not want the information to be used by anybody for direct marketing purposes\n    </li>\n    <li>\n        if you have previously agreed to us using your personal information for direct marketing purposes,\n        you may change your mind at any time by writing to or emailing us at\n        {{config path="trans_email/ident_general/email"}}\n    </li>\n</ul>\n<p>\n    We will not sell, distribute or lease your personal information to third parties unless we have your permission\n    or are required by law to do so. We may use your personal information to send you promotional information\n    about third parties which we think you may find interesting if you tell us that you wish this to happen.\n</p>\n<p>\n    You may request details of personal information which we hold about you under the Data Protection Act 1998.\n    A small fee will be payable. If you would like a copy of the information held on you please write to\n    {{config path="general/store_information/address"}}.\n</p>\n<p>\n    If you believe that any information we are holding on you is incorrect or incomplete,\n    please write to or email us as soon as possible, at the above address.\n    We will promptly correct any information found to be incorrect.\n</p>\n<h2><a name="list"></a>List of cookies we collect</h2>\n<p>The table below lists the cookies we collect and what information they store.</p>\n<table class="data-table">\n    <thead>\n        <tr>\n            <th>COOKIE name</th>\n            <th>COOKIE Description</th>\n        </tr>\n    </thead>\n    <tbody>\n        <tr>\n            <th>CART</th>\n            <td>The association with your shopping cart.</td>\n        </tr>\n        <tr>\n            <th>CATEGORY_INFO</th>\n            <td>Stores the category info on the page, that allows to display pages more quickly.</td>\n        </tr>\n        <tr>\n            <th>COMPARE</th>\n            <td>The items that you have in the Compare Products list.</td>\n        </tr>\n        <tr>\n            <th>CURRENCY</th>\n            <td>Your preferred currency</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER</th>\n            <td>An encrypted version of your customer id with the store.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_AUTH</th>\n            <td>An indicator if you are currently logged into the store.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_INFO</th>\n            <td>An encrypted version of the customer group you belong to.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_SEGMENT_IDS</th>\n            <td>Stores the Customer Segment ID</td>\n        </tr>\n        <tr>\n            <th>EXTERNAL_NO_CACHE</th>\n            <td>A flag, which indicates whether caching is disabled or not.</td>\n        </tr>\n        <tr>\n            <th>FRONTEND</th>\n            <td>You sesssion ID on the server.</td>\n        </tr>\n        <tr>\n            <th>GUEST-VIEW</th>\n            <td>Allows guests to edit their orders.</td>\n        </tr>\n        <tr>\n            <th>LAST_CATEGORY</th>\n            <td>The last category you visited.</td>\n        </tr>\n        <tr>\n            <th>LAST_PRODUCT</th>\n            <td>The most recent product you have viewed.</td>\n        </tr>\n        <tr>\n            <th>NEWMESSAGE</th>\n            <td>Indicates whether a new message has been received.</td>\n        </tr>\n        <tr>\n            <th>NO_CACHE</th>\n            <td>Indicates whether it is allowed to use cache.</td>\n        </tr>\n        <tr>\n            <th>PERSISTENT_SHOPPING_CART</th>\n            <td>A link to information about your cart and viewing history if you have asked the site.</td>\n        </tr>\n        <tr>\n            <th>POLL</th>\n            <td>The ID of any polls you have recently voted in.</td>\n        </tr>\n        <tr>\n            <th>POLLN</th>\n            <td>Information on what polls you have voted on.</td>\n        </tr>\n        <tr>\n            <th>RECENTLYCOMPARED</th>\n            <td>The items that you have recently compared.            </td>\n        </tr>\n        <tr>\n            <th>STF</th>\n            <td>Information on products you have emailed to friends.</td>\n        </tr>\n        <tr>\n            <th>STORE</th>\n            <td>The store view or language you have selected.</td>\n        </tr>\n        <tr>\n            <th>USER_ALLOWED_SAVE_COOKIE</th>\n            <td>Indicates whether a customer allowed to use cookies.</td>\n        </tr>\n        <tr>\n            <th>VIEWED_PRODUCT_IDS</th>\n            <td>The products that you have recently viewed.</td>\n        </tr>\n        <tr>\n            <th>WISHLIST</th>\n            <td>An encrypted list of products added to your Wishlist.</td>\n        </tr>\n        <tr>\n            <th>WISHLIST_CNT</th>\n            <td>The number of items in your Wishlist.</td>\n        </tr>\n    </tbody>\n</table>', '2015-04-07 04:53:24', '2015-04-07 04:53:24', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 'About Us', 'one_column', NULL, NULL, 'about-us', NULL, '<p>kitnekaa.com is India''s first online marketplace catering exclusively to the woodworking industry.</p>\r\n<p>As we watch how the USD15 Billion industry grows at a phenomenal rate, we become painfully aware of the lack of a single place where price and quality benchmarks for products and services may be easily established by various participants of the industry.</p>\r\n<p>kitnekaa is a unique service that provides Sales and Purchase Platforms that the industry needs in order to scale up to the rapidly widening industry.</p>\r\n<p>With over 30 categories of products and services being offered by manufacturers, importers, distributors, dealers and traders from across the world, it spans everything from lumber to furniture in a business to business model.</p>\r\n<p>Participants can maintain their Shopping Lists online for every project being executed with single click resulting in multiple quotations being delivered to their inbox for comparison. For regular shoppers, kitnekaa offers a Procurement concierge service that will assist them in getting the best deal.</p>\r\n<p>Buying products for business is not as straightforward as using your credit card to buy products from websites. This is where kitnekaa is suited most for an online offline mode of business. While buyers can directly buy products online using a variety of payment options, they can also opt to transact with premium sellers directly by requesting quotations, reviewing quotations, rejecting non competitive quotations, placing orders and tracking shipment or with kitnekaa Procurement Executives in the case of non premium sellers.</p>\r\n<p>The exact converse is true for Sellers. kitnekaa acts on behalf of Sellers to represent their products and help extend their reach to newer customers. kitnekaa''s technology lends itself naturally to creating multiple sale opportunities with existing customers.</p>\r\n<p>Get in touch with us today to find out how we can help bring about a positive change to your business in this financial year itself.</p>', '2015-09-30 13:16:15', '2015-09-30 13:18:48', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(8, 'Terms Of Use', 'one_column', NULL, NULL, 'terms_of_use', NULL, '<div class="page-title">\r\n            <h1>Terms of use <span class="current_list_name" style="color:#f4a137;"></span></h1>\r\n        </div>\r\n<p>The agreement between you and Kitnekaa.com is subject to the following terms and conditions:</p>\r\n<ul class="bulletpoint-1">\r\n<li>The User certifies that he/she is at least 18 (eighteen) years of age.</li>\r\n<li>These terms and conditions supersede all previous representations, understandings, or agreements and shall prevail notwithstanding any variance with any other terms of any order submitted or your login through other group or related ID. By using the Shopping services of Kitnekaa.com you agree to be bound by the Terms and Conditions.</li>\r\n<li>All prices, unless indicated otherwise are in Indian Rupees.</li>\r\n<li>By indicating User''s acceptance to purchase any product or service offered on the site, user is obligated to complete such transactions after making payment. Users shall prohibit from indicating its acceptance to purchase products and services where it does not intend to complete such transactions.</li>\r\n<li>Kitnekaa.com is neither responsible for any non-performance or breach of any contract entered into between Users nor make any representation or Warranty as to the attributes (such as quality, worth, of the products or services proposed to be sold or offered to be sold by the seller or purchased by the buyer, on the Website.</li>\r\n<li>You are advised to independently verify the bona fides of any particular seller that you choose to deal with on the Website and use your best judgment in that behalf of Kitnekaa.com, accepts no liability for any errors or omissions, whether on behalf of itself or its Sellers or third parties.</li>\r\n<li>Pricing on any product(s) as is reflected on the Website may due to some technical issue, typographical error or product information published by seller may be incorrectly reflected. Any order placed for a product that is listed at an incorrect price may be cancelled. This shall be regardless of whether the order has been confirmed and/or payment levied. In the event the payment has been processed, the same shall be credited to your account and duly notified thru e mail.</li>\r\n<li>In a credit card transaction, you must use your own credit card. Kitnekaa.com will not be liable for any credit card fraud. The liability to use a card fraudulently will be on the user and the onus to ''prove otherwise'' shall be exclusively on the user. To provide a safe and secure shopping experience, we regularly monitor transactions for fraudulent activity. In the event of detecting any suspicious activity, Kitnekaa.com reserves the right to cancel all past, pending and future orders without any liability.</li>\r\n<li>Kitnekaa.com is not responsible for non-delivery, unsatisfactory or delayed performance of services or damages or delays as a result of items which are out ofStock, back ordered or otherwise unavailable. All items are offered only for a restricted time and only for the available supply. It is the sole responsibility of the Vendor to dispatch the Product to the User (depending on the Product or Offer Price). Any request for cancellations of orders once duly placed on the site, shall not be entertained.</li>\r\n<li>In the event that a non-delivery occurs on account of a mistake by you (i.e. wrong name or address) any extra cost towards re-delivery shall be claimed from you.</li>\r\n<li>Shipment/delivery time of order processing starts from the day of receipt of the payment confirmed against the order placed with Kitnekaa.com.. In case of COD (cash on delivery) orders, the expected delivery time shall be calculated from the date of placing the order. The Shipment /Delivery time is an approximate time mentioned by the vendor against each product. Times Internet Limited shall not be liable for any delay / non-delivery of purchased goods by the Vendors due to any force majeure event including but not limited to flood, fire, wars, acts of God or any event beyond the control of Kitnekaa.com.</li>\r\n<li>Notwithstanding anything contained herein, Kitnekaa.com acts only as booking agent to facilitate / integrate transactions between the Buyers and Sellers through various platforms (online web store, print ads, call centre, mail order catalogues, SMS etc.) for various Vendors and shall in no way be responsible for any quality of product, replacement, damages, additional cost, losses, expenses and/or taxes incurred by Users qua the products. In no event shall Kitnekaa.com, its directors, officials, representatives and employees are liable for any damages relating to products sold through its various platforms including but not limited to Kitnekaa.com Shopping.</li>\r\n<li>Presently, the browsing and buying service(s) of Kitnekaa.com Shopping are being offered free of cost. However, Kitnekaa.com reserves the right to charge a fee for any or such facilities.</li>\r\n<li>The User agrees to use the services provided by Kitnekaa.com, its affiliates, consultants and contracted companies, for lawful purposes only.</li>\r\n<li>The User agrees not to make any bulk purchase to indulge into any reseller activities. In case of any such instances, Kitnekaa.com reserves all rights to cancel the current and future orders and block the concerned User account.</li>\r\n<li>The User agrees to provide authentic and true information. Kitnekaa.com reserves the right to confirm and validate the information and other details provided by the User at any point of time. If upon confirmation such User details are found to be false, not to be true (wholly or partly), Kitnekaa.com shall in its sole discretion reject the registration and debar the User from using the Services available on its website, and / or other affiliated websites without prior intimation whatsoever.</li>\r\n<li>Kitnekaa.com will not be responsible for any damage suffered by users from use of the services on this site. This without limitation includes loss of revenue/data resulting from delays, non-deliveries, missed deliveries, or service interruptions as may occur because of any act / omission of the Vendor. This disclaimer of liability also applies to any damages or injury caused by any failure of performance, error, omission, interruption, deletion, defect, delay in operation or transmission, computer virus, line failure, theft or destruction or unauthorized access to, alteration of, or use of record, whether for breach of contract, tortuous behavior, negligence, or under any other cause of action.</li>\r\n<li>Partial delivery of product needs to be reported within 24 hrs of receipt of the product.</li>\r\n<li>Cancellation on user''s request may not be allowed, subject to the specific terms and conditions applicable to the type of product or service purchased.</li>\r\n<li>All order/sub orders cancelled will be refunded as per the payment mode selected by customer except for COD/Cheque pay mode, where refund shall be processed via Cheque.</li>\r\n<li>Delivery of orders would be done address specific not person/time specific.</li>\r\n<li>Gift Certificate issued by Kitnekaa.com shall be sent to and linked with the email id mentioned during the order placement only.</li>\r\n<li>For reported defects on products with manufacturer''s warranty the customer needs to contact the relevant service center of the manufacturer, respectively. Kitnekaa.com shall not be held responsible for any refund claim in such a case from the customer.</li>\r\n<li>Kitnekaa.com reserves the right to cancel any order placed using Credit Card which holds International Billing Address.</li>\r\n<li>Kitnekaa.com reserves the right to cancel any order placed which is not available, out ofSTOCK or in short supply.</li>\r\n<li>Octroi charges may be levied on some products displayed on the site .These charges shall are not refundable and shall be borne by the customer. In the event of cancellation of the order the ,Octroi charges levied shall not be refunded.</li>\r\n<li>We (Kitnekaa.com) as a merchant shall be under no liability whatsoever in respect of any loss or damage arising directly or indirectly out of the decline of authorization for any Transaction, on Account of the Cardholder having exceeded the preset limit mutually agreed by us with our acquiring bank from time to time.</li>\r\n<li>Kitnekaa.com reserves the right to send transactional emails and SMS''s related to any order placed by a customer and the customer agrees that the same will not tantamount to spam. By submitting your mobile number, you agree to receive calls/SMS''s from Times Internet Limited or its authorized representative, irrespective of your registration on Do Not Disturb (DND) with your telecom service provider.</li>\r\n<li>You agree to receive calls from Kitnekaa.com and its agents, merchants, courier partners seeking clarification/information regarding your order and any other related information as and when required and disclaim any liability of Kitnekaa.com in this regard.</li>\r\n</ul>', '2015-09-30 15:38:26', '2015-09-30 15:53:21', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
