INSERT INTO `core_email_template` (`template_id`, `template_code`, `template_text`, `template_styles`, `template_type`, `template_subject`, `template_sender_name`, `template_sender_email`, `added_at`, `modified_at`, `orig_template_code`, `orig_template_variables`) VALUES
(1, 'demo_account_confirm', '{{template config_path="design/email/header"}}\r\n{{inlinecss file="email-inline.css"}}\r\n\r\n<table cellpadding="0" cellspacing="0" border="0">\r\n    <tr>\r\n        <td>\r\n            <table cellpadding="0" cellspacing="0" border="0">\r\n                <tr>\r\n                    <td class="action-content">\r\n                        <h1>{{htmlescape var=$customer.name}},</h1>\r\n                        <p>Your email {{var customer.email}} must be confirmed before using it to log in to our store.</p>\r\n                        <p class="highlighted-text">\r\n                            Use the following values when prompted to log in:<br/>\r\n                            <strong>Email:</strong> {{var customer.email}}<br/>\r\n                            <strong>Password:</strong> {{htmlescape var=$customer.password}}\r\n                            <strong>Email:</strong> {{var customer.company}}<br/>\r\n                        </p>\r\n                        <p>Click here to confirm your email and instantly log in (the link is valid only once):</p>\r\n                        <table cellspacing="0" cellpadding="0" class="action-button" >\r\n                            <tr>\r\n                                <td>\r\n                                    <a href="{{store url="customer/account/confirm/" _query_id=$customer.id _query_key=$customer.confirmation _query_back_url=$back_url}}"><span>Confirm Account</span></a>\r\n                                </td>\r\n                            </tr>\r\n                        </table>\r\n                        <p>\r\n                            If you have any questions, please feel free to contact us at\r\n                            <a href="mailto:{{var store_email}}">{{var store_email}}</a>\r\n                            {{depend store_phone}} or by phone at <a href="tel:{{var phone}}">{{var store_phone}}</a>{{/depend}}.\r\n                        </p>\r\n                    </td>\r\n                </tr>\r\n            </table>\r\n        </td>\r\n    </tr>\r\n</table>\r\n\r\n{{template config_path="design/email/footer"}}', NULL, 2, 'Account confirmation for {{var customer.name}}', NULL, NULL, '2015-09-26 16:14:07', '2015-09-26 16:14:07', 'customer_create_account_email_confirmation_template', '{"store url=\\"\\"":"Store Url","var logo_url":"Email Logo Image Url","var logo_alt":"Email Logo Image Alt","store url=\\"customer/account/\\"":"Customer Account Url","htmlescape var=$customer.name":"Customer Name","var customer.email":"Customer Email","store url=\\"customer/account/confirm/\\" _query_id=$customer.id _query_key=$customer.confirmation _query_back_url=$back_url":"Confirmation Url","htmlescape var=$customer.password":"Customer password"}');
